        return (
            <Grid container justify="center">
                <Grid item align="center" xs={12} md={2}>
                    <div>
                        <img src="http://localhost:3000/src/images/Homescreen_BG.jpg" alt="backgroundHome" className="backgroundHome" />
                        <img src={HomescreenBG} />
                    </div>
                </Grid>
            </Grid>


        )
    }
}

export default Home;
